INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40011, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", "リリ", 1, 0, 24001, 321, 125801, 2, 1);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40011, 1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア", 2, 0, 24001, 322, 126001, 2, 1);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40011, 1, "んーと。\nこれ、あげる。\nはい", "プレシア", 3, 0, 24001, 323, 126101, 2, 1);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40011, 2, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", "リリ", 4, 0, 24001, 324, 125801, 2, 1);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40011, 2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 5, 0, 24001, 325, 126001, 2, 1);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (40011, 2, "お兄。\nきてくれて、うれしい", "プレシア", 6, 0, 24001, 326, 126101, 2, 1);
